import React from "react";
import "./App.css";
import ScrollToTop from "react-scroll-to-top";
//import { ReactComponent as MySVG } from "/assets/back-to-top.svg";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
// import { Navbar, Nav, NavDropdown, Container, Row, Col } from "react-bootstrap";
// import DropdownMenu from 'react-bootstrap/Dropdown';
import "./Navbar.css";
import "bootstrap/dist/css/bootstrap.css";
import Topbar from "./components/Topbar";
import Footer from "./components/Footer";
import Home from "./pages/Home";
import Contact from "./pages/Contact";
import MbbsRussia from "./pages/MbbsRussia";
import MbbsUkraine from "./pages/MbbsUkraine";
import MbbsArmenia from "./pages/MbbsArmenia";
import MbbsBelize from "./pages/MbbsBelize";
import MbbsFrance from "./pages/MbbsFrance";
import MbbsGeorgia from "./pages/MbbsGeorgia";
import MbbsKazakhstan from "./pages/MbbsKazakhstan";


class App extends React.Component {

  componentDidMount() {
    const script = document.createElement("script");
    script.src = "/src/NavHeader.js";
    script.async = true;
    script.onload = () => this.scriptLoaded();

    document.body.appendChild(script);
  }

  render() {
    return (
      <div className="app">
      <Router>
        <Topbar />
        <ScrollToTop smooth svgPath/>
        {/*<ScrollToTop smooth component={<MySVG />} /> */}
        <nav>
          <ul class="menu">
            <li class="logo"><a href="#">Invisible App</a></li>
            <li class="item"><a href="#">Home</a></li>
            <li class="item"><a href="#">About</a></li>
            <li class="item"><a href="#">Services</a></li>
            <li class="item"><a href="#">Features</a></li>
            <li class="item"><a href="#">Blog</a></li>
            <li class="item"><a href="#">Contact</a>
            </li>
            <li class="item button"><a href="#">Log In</a></li>
            <li class="item button secondary"><a href="#">Sign Up</a></li>
            <li class="toggle"><a href="#"><i class="fas fa-bars"></i></a></li>
          </ul>
        </nav>

        <Switch>
          <Route path="/" exact>
            <Home />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
          <Route path="/mbbs-in-russia">
            <MbbsRussia />
          </Route>
          <Route path="/mbbs-in-ukraine">
            <MbbsUkraine />
          </Route>
          <Route path="/mbbs-in-armenia">
            <MbbsArmenia />
          </Route>
          <Route path="/mbbs-in-belize">
            <MbbsBelize />
          </Route>
          <Route path="/mbbs-in-france">
            <MbbsFrance />
          </Route>
          <Route path="/mbbs-in-georgia">
            <MbbsGeorgia />
          </Route>
          <Route path="/mbbs-in-kazakhstan">
            <MbbsKazakhstan />
          </Route>
        </Switch>
        <Footer />
      </Router>
    </div>
    );
  }
}


export default App;
